
puzzleInput = ''

def solve(x):
    tx = ''
    alphabet = 'abcdefghijklmnopqrstuvwxyz'
    table = [x+x.upper() for x in alphabet] + [x.upper() + x for x in alphabet]
    while tx != x:
        tx = x
        for char in table:
            x = x.replace(char,'')      
    return x

def solveP2(x):
    a = solve(x)
    d = {each:len(solve(a.replace(each,'').replace(each.upper(),''))) for each in 'abcdefghijklmnopqrstuvwxyz'}
    return d[min(d,key=d.get)]

    
print(len(solve(puzzleInput)))
print(solveP2(puzzleInput))